import Heading from "../layout/Heading";
import ReferenceMenu from "./ReferenceMenu";
import BathroomCall from "./sections/Bathroom";
import DoorsCall from "./sections/Doors";
import GarageCall from "./sections/Garage";
import OutdoorsCall from "./sections/Outdoors";
import RehabCall from "./sections/Rehab";

export default function ReferencesPage() {
	return (
		<div className="reference-container">
			<Heading content="Referanser" />
            <div className="references-container-content"></div>
			<ReferenceMenu />
            <BathroomCall />
            <DoorsCall />
            <GarageCall />
            <OutdoorsCall />
            <RehabCall />  
		</div>
	);
}
